package sangee;

import java.util.HashSet;
import java.util.Set;

public class SetProgram {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		 Set<String> set=new HashSet<String>();
	        set.add("Sangee");
	        set.add("arun");
	        for(String s:set){
	            System.out.println(s);
	        }

	}

}
